8.sql_query:
SELECT *
FROM object
WHERE ndet >= 30
  AND deltajd > 20
  AND (
    /* Subquery to get min corrected g-band magnitude */
    (SELECT magmin_corr FROM magstat WHERE oid = object.oid AND fid = 1 ORDER BY magmin_corr ASC LIMIT 1)
    -
    /* Subquery to get min corrected r-band magnitude */
    (SELECT magmin_corr FROM magstat WHERE oid = object.oid AND fid = 2 ORDER BY magmin_corr ASC LIMIT 1)
  ) > 3.5
LIMIT 20;

